import {atom} from "recoil";

export const countryListState = atom({
  key: 'countryListState',
  default: [
    {code: "KR", country: "한국"},
    {code: "JP", country: "일본"},
    {code: "US", country: "미국"},
    {code: "HK", country: "홍콩"},
    {code: "GB", country: "영국"},
    {code: "FR", country: "프랑스"},
    {code: "ETC", country: "기타"},
  ],
});
